import React from 'react';
import Filter from './filter';

class Filters extends React.Component {
    constructor (props) {
        super (props);
    }
    render () {
        for (const element of this.props.species) {
            console.log("element", element);
          }
        return (
            <div>
                <Filter filterType="species" species={this.props.species}></Filter>
                <Filter filterType="gender" gender={this.props.gender}></Filter>
                <Filter filterType="origin" origin={this.props.origin}></Filter>
            </div>
        )
    }
}

export default Filters;
